import React from "react"

class MoonRiset extends React.Component {
  render() {
    return (
      <div className="riset__info">
        {// Display moonrise and moonset
        }
        {(this.props.moonset === "") ? null : <p className="riset__key"> Sunset: {this.props.moonset} </p>}
        {(this.props.moonrise === "") ? null : <p className="riset__key"> Sunrise: {this.props.moonrise} </p>}
      </div>
    )
  }
}

export default MoonRiset;
